import './css/App.css';
import {
    BrowserRouter,
    Routes,
    Route
  } from "react-router-dom";

function App() {
  return (
    <div className="App">

      <Header/>
        <Routes>
            <Route path="/profileBrowser" element={<ProfileBrowser/>}/>
            <Route path ="/about" element = {<About/>}/>
            <Route path="/results/:id" element ={<Results/>}/>
            <Route path="/form" element ={<Form/>}/>
        </Routes>
      <Footer/>
    </div>
  );
}

export default App;
